import styled from 'styled-components';

export const TextSection = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    background-color:#202020;  

    p {
        font-size: 40px;
        margin-top: -5px;
        margin-bottom: 0;
        padding: 100px;
    }
`;

export default TextSection;
